eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   escaperooms: () => (/* binding */ escaperooms)\n/* harmony export */ });\n\nconst escaperooms = [\n    // mock data de momento\n    {\n        escaperoomname: \"theClickTrap\",\n        category: \"escaperoom\",\n        theme_en: \"media literacy\",\n        theme_es: \"alfabetizacin meditica\",\n        theme_fi: \"medialukutaito\",\n        theme_sr: \"medijska pismenost\",\n        title_en: \"The Click Trap\",\n        title_es: \"The Click Trap\",\n        title_fi: \"The Click Trap\",\n        title_sr: \"The Click Trap\",\n        duration_en: \"1 hour\",\n        duration_es: \"1 hora\",\n        duration_fi: \"1 tunti\",\n        duration_sr: \"1 sat\",\n        level_en: \"easy\",\n        level_es: \"fcil\",\n        level_fi: \"helppo\",\n        level_sr: \"lako\",\n        moreInfo_en: \"more info\",\n        moreInfo_es: \"ms info\",\n        moreInfo_fi: \"listietoja\",\n        moreInfo_sr: \"vie informacija\",\n        longdescription_en: \"At ConnectNow, a well-known influencer agency and content producer, rumours are beginning to circulate about suspicious activities: secret meetings, restricted areas and unethical agreements. Your friend Lena, an independent influencer who works with them, suspects that some people are promoting a supplement called GlowUp+ using misleading health and nutrition information, putting young people at risk. To help her, you infiltrate the company as a janitor to obtain evidence from withindocuments, photos, and digital recordsbefore they are deleted. The goal of the game is to uncover and expose how economic interests and irresponsible content creation fuel misinformation, encouraging critical thinking and source verification.\",\n        longdescription_es: \"En ConnectNow, una conocida agencia de influencers y productora de contenidos, comienzan a circular rumores sobre actividades sospechosas: reuniones secretas, reas restringidas y acuerdos poco ticos. Tu amiga Lena, una influencer independiente que colabora con ellos, sospecha que algunos estn promoviendo un suplemento llamado GlowUp+ mediante informacin engaosa sobre salud y alimentacin, poniendo en riesgo a los jvenes. Para ayudarla, te infiltras como conserje para obtener pruebas desde dentro documentos, fotos y registros digitales antes de que los borren. El objetivo del juego es descubrir y exponer cmo los intereses econmicos y la creacin irresponsable de contenido alimentan la desinformacin, fomentando el pensamiento crtico y la verificacin de fuentes.\",\n        longdescription_fi: \"ConnectNow, tunnettu vaikuttajien agentuuri ja sisllntuottaja, on alkanut kiert huhuja epilyttvist toimista: salaisista kokouksista, rajoitetuista alueista ja epeettisist sopimuksista. Ystvsi Lena, itseninen vaikuttaja, joka tekee yhteistyt heidn kanssaan, epilee, ett jotkut mainostavat GlowUp+ -nimist ravintolis antamalla harhaanjohtavaa tietoa terveydest ja ravitsemuksesta, mik vaarantaa nuorten terveyden. Auttaaksesi hnt soluttaudut talonmieheksi kermn todisteita sisltpin  asiakirjoja, valokuvia ja digitaalisia tietoja  ennen kuin ne tuhotaan. Pelin tavoitteena on paljastaa, kuinka taloudelliset intressit ja vastuuton sisllntuotanto ruokkivat vr tietoa, ja kannustaa kriittiseen ajatteluun ja lhteiden tarkistamiseen.\",\n        longdescription_sr: \"Tunnetussa vaikuttajatoimistossa ja sisllntuottajassa ConnectNowssa alkaa kiert huhuja epilyttvist toimista: salaisista tapaamisista, rajoitetuista alueista ja epeettisist sopimuksista. Ystvsi Lena, heidn kanssaan tyskentelev itseninen vaikuttaja, epilee, ett jotkut mainostavat GlowUp+-nimist lisravinnetta harhaanjohtavilla terveys- ja ravitsemustiedoilla, mik asettaa nuoret vaaraan. Auttaaksesi hnt soluttaudut yritykseen vahtimestarina hankkiaksesi todisteita sislt  asiakirjoja, valokuvia ja digitaalisia tallenteita  ennen kuin ne poistetaan. Pelin tavoitteena on paljastaa, miten taloudelliset edut ja vastuuton sisllntuotanto ruokkivat vr tietoa, kannustaen kriittiseen ajatteluun ja lhteiden varmentamiseen.\",\n        keywords: [\n            \"escaperoom\",\n            \"Media literacy\",\n            \"misinformation\"\n        ],\n        image: \"/assets/images/EndgameBackground.png\",\n        claim_en: \"Become the insider who uncovers the truth: stop misinformation.\",\n        claim_es: \"Convirtete en el infiltrado que destapa la verdad: frena la desinformacin.\",\n        claim_fi: \"Ryhdy sispiiriliseksi, joka paljastaa totuuden: lopeta vrn tiedon levittminen.\",\n        claim_sr: \"Postanite insajder koji otkriva istinu: zaustavite dezinformacije.\",\n        externalLink: \"https://play.unity.com/en/games/3e199a2b-03aa-44c1-9ecd-5f9a308280cc/webgl-builds\",\n        resources: [\n            {\n                resourceName: \"Teacher's Guide\",\n                resourceName_es: \"Gua didctica\",\n                resourceName_en: \"Teacher's Guide\",\n                resourceName_sr: \"Vodi za nastavnike\",\n                resourceName_fi: \"Opettajan opas\",\n                additionalInfo: \"Teacher's Guide for educators to facilitate the escaperoom activity\",\n                additionalInfo_es: \"Gua didctica para educadores para facilitar la actividad de escaperoom\",\n                additionalInfo_sr: \"Vodi za nastavnike i edukatore kako bi se olakala aktivnost u sobi za bekstvo\",\n                additionalInfo_fi: \"Opettajan opas kouluttajille pakohuonetoiminnan helpottamiseksi\",\n                tag: \"Docs\",\n                resourceLink_es: \"https://docs.google.com/document/d/1QMLHAEaBetoKYbuLx2xALDGbi1-96IgJ/export?format=pdf\",\n                resourceLink_en: \"https://docs.google.com/document/d/1VSxRpjjeqkFae5qvW-HxNOaAEf7FfdkI/export?format=pdf\"\n            }\n        ]\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./constants/escaperooms.js\n");

