"use strict";
eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   events: () => (/* binding */ events)\n/* harmony export */ });\nconst events = [\n    {\n        eventname: \"PressNote011225\",\n        category: \"\",\n        country: \"International\",\n        type: \"news\",\n        date: \"12/01/25\",\n        author: \"\",\n        title_en: \"ENDGAME launches its first educational escape room to teach how to detect misinformation about food and health\",\n        title_sr: \"ENDGAME lansira svoju prvu edukativnu escape room igru za uenje prepoznavanja dezinformacija o hrani i zdravlju\",\n        title_es: \"ENDGAME lanza su primer escape room educativo para ensear a detectar la desinformacin sobre alimentacin y salud\",\n        description_en: \"We have launched The Click Trap, an educational escape room designed to combat disinformation and strengthen media literacy among young people. It includes a teachers guide and will be piloted in schools across Spain, Finland, and Serbia, with versions available in multiple languages.\",\n        description_sr: \"Evropski projekat ENDGAME pokrenuo je The Click Trap, edukativnu escape room igru namenjenu borbi protiv dezinformacija i jaanju medijske pismenosti meu mladima. Uz igru dolazi i vodi za nastavnike, a bie testirana u kolama u paniji, Finskoj i Srbiji, uz verzije dostupne na vie jezika.\",\n        description_es: \"Lanzamos The Click Trap, un escape room educativo para combatir la desinformacin y fortalecer la alfabetizacin meditica juvenil. Incluye una gua docente y ser probado en colegios de Espaa, Finlandia y Serbia, con versiones disponibles en varios idiomas.\",\n        image: \"/assets/images/EndgameBackground.png\",\n        imagePosition: \"bottom\",\n        htmlbody_en: `    \n<p>The European project <b>ENDGAME</b> (Escaping New Disinformation through Gamified Cross-Border Media Literacy Education), led by the <b><a href=\"https://www.uef.fi/fi\">University of Eastern Finland</a></b> (UEF, Finland) and consisting of the <b><a href=\"https://www.upm.es/\">Technical University of Madrid</a></b> (UPM, Spain), the <b><a href=\"https://www.metropolitan.ac.rs/en/about-metropolitan-university/\">Metropolitan University of Belgrade</a></b> (BMU, Serbia), <b><a href=\"https://faktabaari.fi/in-english/\">Faktabaari</a></b> (Faktabaari, Finland), <b><a href=\"https://novinarska-skola.org.rs/\">Novi Sad School of Journalism</a></b> (FNT, Serbia) and Fundacin <b><a href=\"http://Maldita.es\">Maldita.es</a></b> (Maldita.es, Spain), has developed an educational escape room, <a href=\"https://endgameproject.github.io/escaperooms/theClickTrap\"><b>The Click Trap</b></a>, along with <a href=\"https://docs.google.com/document/d/1VSxRpjjeqkFae5qvW-HxNOaAEf7FfdkI/export?format=pdf\" target=\"_blank\" >a teachers guide</a> designed to help educators work on media literacy and critical thinking in the classroom. Both resources will be tested over the coming months in schools in Spain, Finland and Serbia. This is the first of the three escape rooms that the project will develop between 2025 and 2027.</p>\n<br/>\n<h2>A game to escape misinformation</h2>\n\n<p>In The Click Trap, the player takes on the role of a janitor who infiltrates the influencer agency ConnectNow, which is promoting <b>GlowUp+</b>, a dietary supplement with questionable health benefits. Over 45 minutes, with the help of Lena, an influencer from the agency who also wants to expose its bad practices, the player must gather the necessary information to dismantle this misinformation campaign before the evidence is destroyed.</p>\n\n<p>The escape room presents situations based on real cases of misinformation about food and health, a topic that is particularly sensitive among European youth. Throughout the game, students learn to recognise manipulation techniques, assess the reliability of sources and reflect on the economic factors that fuel misinformation.</p>\n<br/>\n<h2>A guide to bring the game into the classroom</h2>\n\n<p>The escape room is accompanied by <a href=\"https://docs.google.com/document/d/1VSxRpjjeqkFae5qvW-HxNOaAEf7FfdkI/export?format=pdf\" target=\"_blank\" > a didactic guide</a> providing context on what misinformation on social media is, along with activities to carry out before and after playing the game, designed to activate critical thinking, as well as a step-by-step explanation intended to support the integration of the escape room into classrooms and learning spaces across Europe.</p>\n\n<p>In the coming months, pilot tests of The Click Trap will be carried out in schools in Finland, Serbia and Spain to collect feedback and improve the experience. The project expects to reach nearly 1000 students across the three countries. In addition, the game is available on the projects <a href=\"#\">website</a> in English, Spanish, Serbian and Finnish so it can be played virtually, helping increase the escape rooms impact across Europe.</p>\n  `,\n        htmlbody_sr: `<p>\n    Evropski projekat ENDGAME  Escaping New Disinformation through Gamified cross-border Media literacy Education zvanino je zapoet konsorcijumskim online sastankom, ime je obeleeno pokretanje ove 24-mesene inicijative. Finansiran kroz program Creative Europe (CREA-CROSS-2024-MEDIALITERACY), ENDGAME ima za cilj da opremi evropsku omladinu vetinama za kritiko sagledavanje informacija, prepoznavanje dezinformacija i odgovorno kretanje kroz digitalne medijske sadraje.\n  </p>\n  <h2 className='news'>Projektni partneri:</h2>\n  <ul>\n    <li><strong>University of Eastern Finland (UEF)</strong>  (Finska) Koordinator projekta</li>\n    <li><strong>Faktabaari</strong> (Finska)</li>\n    <li><strong>Belgrade Metropolitan University (BMU)</strong> (Srbija)</li>\n    <li><strong>Novi Sad School of Journalism (FNT)</strong> (Srbija)</li>\n    <li><strong>Universidad Politcnica de Madrid (UPM)</strong> (panija)</li>\n    <li><strong>Fundacin Maldita.es</strong> (panija)</li>\n  </ul>\n  <h2>O projektu</h2>\n  <p>\n  ENDGAME koristi mo edukativnih soba za bekstvo kako bi simulirao scenarije iz stvarnog ivota u oblasti medija, gde uesnici moraju da reavaju zagonetke i izvravaju izazove, istovremeno razvijajui kritiko razmiljanje i medijsku pismenost. Ovi inovativni alati bavie se aktuelnim temama kao to su dezinformacije generisane vetakom inteligencijom, rizici po line podatke i manipulisani sadraji, a bie prilagoeni svakoj partnerskoj zemlji kroz participativni dizajn u saradnji sa lokalnim zajednicama i zainteresovanim stranama.\n  </p>\n  <p>\n  Tokom poetnog sastanka, odranog onlajn u martu 2025. godine, partneri su definisali strateki plan za prvu fazu projekta, ukljuujui zajedniko kreiranje narativa specifinih za svaku zemlju i organizaciju participativnih radionica u Finskoj, Srbiji i paniji. Sobe za bekstvo bie dostupne u kolama, javnim prostorima i onlajn, a pratie ih takmienja, obuke za nastavnike, aktivnosti strimovanja na platformama poput Twitch-a, kao i prezentacije na konferencijama i obrazovnim sajmovima.\n  </p>\n  <p>\n  ENDGAME ima ukupni budet od 712.831,86 , od ega je 498.982,30  sufinansirano od strane Evropske unije. Projekat e obuhvatiti stotine mladih ljudi, edukatora i drugih zainteresovanih strana kroz praktine i inkluzivne aktivnosti, a ujedno e generisati uvide zasnovane na istraivanju o prazninama u medijskoj pismenosti putem analitike uenja.\n  </p>\n  <h2>Pratite nas na drutvenim mreama!</h2>\n  <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Kontakt</h2>\n  <p>\n    <strong>Koordinacija projekta:</strong> UEF, Sonsoles Lpez Pernas  \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a>  \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>\n  `,\n        htmlbody_es: `<p>\n      El proyecto europeo <strong>ENDGAME</strong>  Escaping New Disinformation through Gamified cross-border Media literacy Education ha comenzado oficialmente con una reunin en lnea del consorcio que marca el lanzamiento de esta iniciativa de 24 meses. Financiado por el Programa Europa Creativa (CREA-CROSS-2024-MEDIALITERACY), ENDGAME tiene como objetivo empoderar a la juventud europea con las habilidades para participar crticamente con la informacin, identificar la desinformacin y navegar por los entornos digitales de manera responsable.\n    </p>\n    <h2 className='news'>Socios del proyecto</h2>\n    <ul>\n      <li><strong>University of Eastern Finland (UEF)</strong>  (Finlandia) Coordinador del proyecto</li>\n      <li><strong>Faktabaari</strong> (Finlandia)</li>\n      <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n      <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n      <li><strong>Universidad Politcnica de Madrid (UPM)</strong> (Espaa)</li>\n      <li><strong>Fundacin Maldita.es</strong> (Espaa)</li>\n    </ul>\n    <h2>Sobre el proyecto</h2>\n    <p>\n      ENDGAME aprovecha el poder de las escape rooms educativas para simular escenarios reales de medios en los que los jugadores deben resolver acertijos y completar desafos mientras desarrollan sus habilidades de pensamiento crtico y alfabetizacin meditica. Estas herramientas innovadoras abordarn temas urgentes como la desinformacin generada por IA, los riesgos de datos personales y el contenido manipulado, y se adaptarn a cada pas socio a travs de procesos de diseo participativo que involucren a las comunidades locales y a las partes interesadas.\n    </p>\n    <p>\n      Durante la reunin de lanzamiento, celebrada en lnea en marzo de 2025, los socios definieron la hoja de ruta estratgica para la primera fase del proyecto, que incluye la co-creacin de narrativas especficas de cada pas y la organizacin de talleres participativos en Finlandia, Serbia y Espaa. Las escape rooms estarn disponibles para jugar en escuelas, espacios pblicos y en lnea, complementadas con competiciones, eventos de formacin para docentes, actividades de streaming en plataformas como Twitch y presentaciones en conferencias y ferias educativas.\n    </p>\n    <p>\n      ENDGAME cuenta con un presupuesto total de <strong>712,831.86</strong>, de los cuales <strong>498,982.30</strong> estn cofinanciados por la Unin Europea. El proyecto alcanzar a cientos de jvenes, educadores y otras partes interesadas a travs de actividades prcticas e inclusivas, al tiempo que generar conocimientos basados en la investigacin sobre las brechas en alfabetizacin meditica mediante el anlisis del aprendizaje.\n    </p>\n    <h2>Sguenos en las redes sociales!</h2>\n    <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles Lpez Pernas  \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a>  \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        htmlbody_fi: `<p>\n    Eurooppalainen hanke ENDGAME  Escaping New Disinformation through Gamified cross-border Media literacy Education on virallisesti kynnistynyt verkkotapaamisella, joka toimi lhtlaukauksena tlle 24 kuukautta kestvlle aloitteelle. EU:n Luovan Euroopan ohjelman (CREA-CROSS -2024-MEDIALITERACY) rahoittama ENDGAME pyrkii antamaan eurooppalaisille nuorille taidot kriittiseen informaation ksittelyyn, disinformaation tunnistamiseen sek vastuulliseen navigointiin digitaalisen median ympristiss.\n    </p>\n    <h2 className='news'>Projektikumppanit</h2>\n    <ul>\n      <li><strong>University of Eastern Finland (UEF)</strong>  (Suomi) Projektin koordinaattori</li>\n      <li><strong>Faktabaari</strong> (Suomi)</li>\n      <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n      <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n      <li><strong>Universidad Politcnica de Madrid (UPM)</strong> (Espanja)</li>\n      <li><strong>Fundacin Maldita.es</strong> (Espanja)</li>\n    </ul>\n    <h2>Projektista</h2>\n    <p>\n      ENDGAME hydynt opetuksellisten pakohuoneiden toimivuutta simuloidakseen todellisia mediankyttskenaarioita, joissa pelaajien on ratkaistava pulmia ja suoritettava haasteita samalla kehitten kriittist ajattelua ja medialukutaitoaan. Nm innovatiiviset opetuskeinot ksittelevt ajankohtaisia aiheita, kuten tekolyn tuottamaa disinformaatiota, henkiltietojen riskej ja manipuloitua sislt, ja ne rtlidn kunkin kumppanimaan tarpeisiin osallistavan suunnittelun prosessien kautta, jotka huomioivat paikalliset yhteist ja sidosryhmt.\n  </p>    \n    <p>\n      Kick-off-kokouksessa, joka pidettiin verkossa maaliskuussa 2025, kumppanit mrittelivt strategisen tiekartan projektin ensimmiselle vaiheelle mukaanlukien maakohtaisten narratiivien yhteiskehittely ja osallistavien typajojen jrjestminen Suomessa, Serbiassa ja Espanjassa. Pakohuoneet tulevat olemaan pelattavissa kouluissa, julkisissa paikoissa ja verkossa, ja niit tydentvt kilpailut, opettajankoulutustapahtumat, suoratoistona pelautus Twitchiss sek esitykset konferensseissa ja koulutustapahtumissa.  </p>    \n    <p>\n      ENDGAME-hankkeen kokonaisbudjetti on <strong>712 831,86 </strong>, josta <strong>498 982,30 </strong> on Euroopan unionin rahoittamaa. Projekti tavoittaa satoja nuoria, opettajia ja muita sidosryhmi kytnnnlheisten ja osallistavien toimintojen kautta, tuottaen samalla tutkimukseen perustuvia nkemyksi medialukutaidon tarpeista oppimisanalytikan avulla.\n  </p>\n    <h2>Seuraa meit sosiaalisessa mediassa!</h2>\n    <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles Lpez Pernas  \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a>  \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        // other\n        externalLinkJoin: \"\",\n        keywords: [\n            \"Event Launch\"\n        ],\n        socialLinks: [\n            {\n                name: \"Instagram\",\n                icon: `InstagramIcon`,\n                url: \"https://www.instagram.com/endgame.project\",\n                handle: \"endgame.project\"\n            },\n            {\n                name: \"X (Twitter)\",\n                icon: `TwitterIcon`,\n                url: \"https://twitter.com/endgame_project\",\n                handle: \"endgame_project\"\n            },\n            {\n                name: \"TikTok\",\n                icon: `TikTokIcon`,\n                url: \"https://www.tiktok.com/@endgame.project\",\n                handle: \"@endgame.project\"\n            },\n            {\n                name: \"LinkedIn\",\n                icon: `LinkedInIcon`,\n                url: \"https://www.linkedin.com/company/end-game-project-477149364\",\n                handle: \"end-game-project\"\n            }\n        ]\n    },\n    {\n        eventname: \"PressNote200525\",\n        category: \"\",\n        country: \"International\",\n        type: \"news\",\n        date: \"05/20/25\",\n        author: \"\",\n        title_en: \"ENDGAME: a new EU project to strengthen media literacy through educational escape rooms\",\n        title_sr: \"ENDGAME: novi projekat EU za jaanje medijske pismenosti kroz obrazovne sobe za bekstvo\",\n        title_es: \"ENDGAME: un nuevo proyecto de la UE para fortalecer la alfabetizacin meditica a travs de escape rooms educativas\",\n        title_fi: \"ENDGAME  uusi EU-hanke vahvistamaan medialukutaitoa opetuksellisten pakopelien kautta\",\n        description_en: \"Six organisations from Finland, Serbia, and Spain join forces to fight disinformation among young people using game-based learning\",\n        description_sr: \"est organizacija iz Finske, Srbije i panije udruuju snage u borbi protiv dezinformacija meu mladima kroz uenje zasnovano na igri\",\n        description_es: \"Seis organizaciones de Finlandia, Serbia y Espaa unen fuerzas para combatir la desinformacin entre los jvenes utilizando el aprendizaje basado en juegos\",\n        description_fi: \"Kuusi jrjest Suomesta, Serbiasta ja Espanjasta yhdistvt voimansa nuorten disinformaation torjumiseksi pelipohjaisen oppimisen avulla\",\n        image: \"/newsENDGAME_imagePlaceholder.png\",\n        htmlbody_en: `\n  <p>\n    The European project <strong>ENDGAME</strong>  Escaping New Disinformation through Gamified cross-border Media literacy Education has officially kicked off with a consortium online meeting marking the launch of this 24-month initiative. Funded by the Creative Europe Programme (CREA-CROSS-2024-MEDIALITERACY), ENDGAME aims to empower European youth with the skills to critically engage with information, identify disinformation, and navigate digital media environments responsibly.\n  </p>\n\n  <h2 className='news'>Project Partners</h2>\n  <ul>\n    <li><strong>University of Eastern Finland (UEF)</strong>  (Finland) Project coordinator</li>\n    <li><strong>Faktabaari</strong> (Finland)</li>\n    <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n    <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n    <li><strong>Universidad Politcnica de Madrid (UPM)</strong> (Spain)</li>\n    <li><strong>Fundacin Maldita.es</strong> (Spain)</li>\n  </ul>\n\n  <h2>About the Project</h2>\n  <p>\n    ENDGAME leverages the power of educational escape rooms to simulate real-life media scenarios where players must solve puzzles and complete challenges while building their critical thinking and media literacy skills. These innovative tools will address pressing topics such as AI-generated disinformation, personal data risks, and manipulated content, and will be tailored to each partner country through participatory design processes involving local communities and stakeholders.\n  </p>\n\n  <p>\n    During the kick-off meeting, held online in March 2025, the partners defined the strategic roadmap for the projects first phase, including the co-creation of country-specific narratives and the organisation of participatory workshops in Finland, Serbia and Spain. The escape rooms will be playable in schools, public spaces and online, complemented by competitions, teacher training events, streaming activities on platforms like Twitch, and presentations at conferences and educational fairs.\n  </p>\n\n  <p>\n    ENDGAME has a total budget of <strong>712,831.86</strong>, with <strong>498,982.30</strong> co-funded by the European Union. The project will reach hundreds of young people, educators and other stakeholders through hands-on, inclusive activities, while also generating research-based insights into media literacy gaps via learning analytics.\n  </p>\n\n  <h2>Follow us on Social Media!</h2>\n  <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles Lpez Pernas  \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a>  \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        htmlbody_sr: `<p>\n    Evropski projekat ENDGAME  Escaping New Disinformation through Gamified cross-border Media literacy Education zvanino je zapoet konsorcijumskim online sastankom, ime je obeleeno pokretanje ove 24-mesene inicijative. Finansiran kroz program Creative Europe (CREA-CROSS-2024-MEDIALITERACY), ENDGAME ima za cilj da opremi evropsku omladinu vetinama za kritiko sagledavanje informacija, prepoznavanje dezinformacija i odgovorno kretanje kroz digitalne medijske sadraje.\n  </p>\n  <h2 className='news'>Projektni partneri:</h2>\n  <ul>\n    <li><strong>University of Eastern Finland (UEF)</strong>  (Finska) Koordinator projekta</li>\n    <li><strong>Faktabaari</strong> (Finska)</li>\n    <li><strong>Belgrade Metropolitan University (BMU)</strong> (Srbija)</li>\n    <li><strong>Novi Sad School of Journalism (FNT)</strong> (Srbija)</li>\n    <li><strong>Universidad Politcnica de Madrid (UPM)</strong> (panija)</li>\n    <li><strong>Fundacin Maldita.es</strong> (panija)</li>\n  </ul>\n  <h2>O projektu</h2>\n  <p>\n  ENDGAME koristi mo edukativnih soba za bekstvo kako bi simulirao scenarije iz stvarnog ivota u oblasti medija, gde uesnici moraju da reavaju zagonetke i izvravaju izazove, istovremeno razvijajui kritiko razmiljanje i medijsku pismenost. Ovi inovativni alati bavie se aktuelnim temama kao to su dezinformacije generisane vetakom inteligencijom, rizici po line podatke i manipulisani sadraji, a bie prilagoeni svakoj partnerskoj zemlji kroz participativni dizajn u saradnji sa lokalnim zajednicama i zainteresovanim stranama.\n  </p>\n  <p>\n  Tokom poetnog sastanka, odranog onlajn u martu 2025. godine, partneri su definisali strateki plan za prvu fazu projekta, ukljuujui zajedniko kreiranje narativa specifinih za svaku zemlju i organizaciju participativnih radionica u Finskoj, Srbiji i paniji. Sobe za bekstvo bie dostupne u kolama, javnim prostorima i onlajn, a pratie ih takmienja, obuke za nastavnike, aktivnosti strimovanja na platformama poput Twitch-a, kao i prezentacije na konferencijama i obrazovnim sajmovima.\n  </p>\n  <p>\n  ENDGAME ima ukupni budet od 712.831,86 , od ega je 498.982,30  sufinansirano od strane Evropske unije. Projekat e obuhvatiti stotine mladih ljudi, edukatora i drugih zainteresovanih strana kroz praktine i inkluzivne aktivnosti, a ujedno e generisati uvide zasnovane na istraivanju o prazninama u medijskoj pismenosti putem analitike uenja.\n  </p>\n  <h2>Pratite nas na drutvenim mreama!</h2>\n  <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Kontakt</h2>\n  <p>\n    <strong>Koordinacija projekta:</strong> UEF, Sonsoles Lpez Pernas  \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a>  \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>\n  `,\n        htmlbody_es: `<p>\n      El proyecto europeo <strong>ENDGAME</strong>  Escaping New Disinformation through Gamified cross-border Media literacy Education ha comenzado oficialmente con una reunin en lnea del consorcio que marca el lanzamiento de esta iniciativa de 24 meses. Financiado por el Programa Europa Creativa (CREA-CROSS-2024-MEDIALITERACY), ENDGAME tiene como objetivo empoderar a la juventud europea con las habilidades para participar crticamente con la informacin, identificar la desinformacin y navegar por los entornos digitales de manera responsable.\n    </p>\n    <h2 className='news'>Socios del proyecto</h2>\n    <ul>\n      <li><strong>University of Eastern Finland (UEF)</strong>  (Finlandia) Coordinador del proyecto</li>\n      <li><strong>Faktabaari</strong> (Finlandia)</li>\n      <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n      <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n      <li><strong>Universidad Politcnica de Madrid (UPM)</strong> (Espaa)</li>\n      <li><strong>Fundacin Maldita.es</strong> (Espaa)</li>\n    </ul>\n    <h2>Sobre el proyecto</h2>\n    <p>\n      ENDGAME aprovecha el poder de las escape rooms educativas para simular escenarios reales de medios en los que los jugadores deben resolver acertijos y completar desafos mientras desarrollan sus habilidades de pensamiento crtico y alfabetizacin meditica. Estas herramientas innovadoras abordarn temas urgentes como la desinformacin generada por IA, los riesgos de datos personales y el contenido manipulado, y se adaptarn a cada pas socio a travs de procesos de diseo participativo que involucren a las comunidades locales y a las partes interesadas.\n    </p>\n    <p>\n      Durante la reunin de lanzamiento, celebrada en lnea en marzo de 2025, los socios definieron la hoja de ruta estratgica para la primera fase del proyecto, que incluye la co-creacin de narrativas especficas de cada pas y la organizacin de talleres participativos en Finlandia, Serbia y Espaa. Las escape rooms estarn disponibles para jugar en escuelas, espacios pblicos y en lnea, complementadas con competiciones, eventos de formacin para docentes, actividades de streaming en plataformas como Twitch y presentaciones en conferencias y ferias educativas.\n    </p>\n    <p>\n      ENDGAME cuenta con un presupuesto total de <strong>712,831.86</strong>, de los cuales <strong>498,982.30</strong> estn cofinanciados por la Unin Europea. El proyecto alcanzar a cientos de jvenes, educadores y otras partes interesadas a travs de actividades prcticas e inclusivas, al tiempo que generar conocimientos basados en la investigacin sobre las brechas en alfabetizacin meditica mediante el anlisis del aprendizaje.\n    </p>\n    <h2>Sguenos en las redes sociales!</h2>\n    <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles Lpez Pernas  \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a>  \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        htmlbody_fi: `<p>\n    Eurooppalainen hanke ENDGAME  Escaping New Disinformation through Gamified cross-border Media literacy Education on virallisesti kynnistynyt verkkotapaamisella, joka toimi lhtlaukauksena tlle 24 kuukautta kestvlle aloitteelle. EU:n Luovan Euroopan ohjelman (CREA-CROSS -2024-MEDIALITERACY) rahoittama ENDGAME pyrkii antamaan eurooppalaisille nuorille taidot kriittiseen informaation ksittelyyn, disinformaation tunnistamiseen sek vastuulliseen navigointiin digitaalisen median ympristiss.\n    </p>\n    <h2 className='news'>Projektikumppanit</h2>\n    <ul>\n      <li><strong>University of Eastern Finland (UEF)</strong>  (Suomi) Projektin koordinaattori</li>\n      <li><strong>Faktabaari</strong> (Suomi)</li>\n      <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n      <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n      <li><strong>Universidad Politcnica de Madrid (UPM)</strong> (Espanja)</li>\n      <li><strong>Fundacin Maldita.es</strong> (Espanja)</li>\n    </ul>\n    <h2>Projektista</h2>\n    <p>\n      ENDGAME hydynt opetuksellisten pakohuoneiden toimivuutta simuloidakseen todellisia mediankyttskenaarioita, joissa pelaajien on ratkaistava pulmia ja suoritettava haasteita samalla kehitten kriittist ajattelua ja medialukutaitoaan. Nm innovatiiviset opetuskeinot ksittelevt ajankohtaisia aiheita, kuten tekolyn tuottamaa disinformaatiota, henkiltietojen riskej ja manipuloitua sislt, ja ne rtlidn kunkin kumppanimaan tarpeisiin osallistavan suunnittelun prosessien kautta, jotka huomioivat paikalliset yhteist ja sidosryhmt.\n  </p>    \n    <p>\n      Kick-off-kokouksessa, joka pidettiin verkossa maaliskuussa 2025, kumppanit mrittelivt strategisen tiekartan projektin ensimmiselle vaiheelle mukaanlukien maakohtaisten narratiivien yhteiskehittely ja osallistavien typajojen jrjestminen Suomessa, Serbiassa ja Espanjassa. Pakohuoneet tulevat olemaan pelattavissa kouluissa, julkisissa paikoissa ja verkossa, ja niit tydentvt kilpailut, opettajankoulutustapahtumat, suoratoistona pelautus Twitchiss sek esitykset konferensseissa ja koulutustapahtumissa.  </p>    \n    <p>\n      ENDGAME-hankkeen kokonaisbudjetti on <strong>712 831,86 </strong>, josta <strong>498 982,30 </strong> on Euroopan unionin rahoittamaa. Projekti tavoittaa satoja nuoria, opettajia ja muita sidosryhmi kytnnnlheisten ja osallistavien toimintojen kautta, tuottaen samalla tutkimukseen perustuvia nkemyksi medialukutaidon tarpeista oppimisanalytikan avulla.\n  </p>\n    <h2>Seuraa meit sosiaalisessa mediassa!</h2>\n    <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles Lpez Pernas  \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a>  \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        // other\n        externalLinkJoin: \"\",\n        keywords: [\n            \"Event Launch\"\n        ],\n        socialLinks: [\n            {\n                name: \"Instagram\",\n                icon: `InstagramIcon`,\n                url: \"https://www.instagram.com/endgame.project\",\n                handle: \"endgame.project\"\n            },\n            {\n                name: \"X (Twitter)\",\n                icon: `TwitterIcon`,\n                url: \"https://twitter.com/endgame_project\",\n                handle: \"endgame_project\"\n            },\n            {\n                name: \"TikTok\",\n                icon: `TikTokIcon`,\n                url: \"https://www.tiktok.com/@endgame.project\",\n                handle: \"@endgame.project\"\n            },\n            {\n                name: \"LinkedIn\",\n                icon: `LinkedInIcon`,\n                url: \"https://www.linkedin.com/company/end-game-project-477149364\",\n                handle: \"end-game-project\"\n            }\n        ]\n    },\n    {\n        eventname: \"ParticipatoryDesignWorkshop\",\n        category: \"Workshop\",\n        country: \"International\",\n        type: \"Event\",\n        date: \"05/20/25\",\n        hour: \"15:00 UTC+1\",\n        title_en: \"Designing Educational Escape Rooms to Combat Disinformation\",\n        title_sr: \"Dizajn edukativnih soba za bekstvo za borbu protiv dezinformacija\",\n        title_es: \"Diseo de salas de escape educativas para combatir la desinformacin\",\n        title_fi: \"Opetuksellisten pakopelien suunnittelu disinformaation torjumiseksi\",\n        description_en: `Are you an educator, media literacy expert, designer, or game developer aged 18 to 25  or part of a civil society or media organization? Join us!\nWe invite you to participate in an online international webinar on Tuesday, May 20, at 3:00 PM, where we will co-design the storyline and format of educational escape rooms using a participatory design approach.\nThis two-hour session will bring together experts and young creatives to share their perspectives and collaboratively develop narratives, characters, and puzzles that help youth recognize disinformation and strengthen their critical thinking skills.\nThrough a series of co-design workshops held at several stages of the project, we will define the narrative, format, and themes of the escape rooms in ways that are intrinsically motivating and engaging for the youth  going beyond traditional learning activities. We are committed to involving diverse groups  including individuals from different genders, ethnicities, abilities, and backgrounds  to ensure the visuals and storylines are inclusive, respectful, and relevant to a wide audience.`,\n        description_sr: `Da li ste nastavnik, strunjak za medijsku pismenost, dizajner ili developer igara uzrasta od 18 do 25 godina  ili deo organizacije civilnog drutva ili medijske organizacije? Pridruite nam se!\nPozivamo vas da uestvujete na meunarodnom vebinaru koji e se odrati onlajn u utorak, 20. maja, u 15:00 asova, gde emo zajedniki osmiljavati priu i format edukativnih soba za bekstvo koristei pristup participativnog dizajna.\nOva dvoasovna sesija okupie strunjake i mlade kreativce kako bi podelili svoje perspektive i zajedno razvili narative, likove i zagonetke koje pomau mladima da prepoznaju dezinformacije i ojaaju svoje vetine kritikog miljenja.\nKroz niz radionica participativnog dizajna koje e se odravati u razliitim fazama projekta, definisaemo narativ, format i teme soba za bekstvo na nain koji motivie i angauje mlade  prevazilazei granice tradicionalnih obrazovnih aktivnosti. Posveeni smo ukljuivanju razliitih grupa  ukljuujui osobe razliitog pola, etnike pripadnosti, sposobnosti i porekla  kako bismo osigurali da vizuali i prie budu inkluzivni, sa potovanjem predstavljeni i relevantni za iroku publiku.`,\n        description_es: `Eres educador, experto en alfabetizacin meditica, diseador o desarrollador de juegos, o formas parte de una organizacin de la sociedad civil o de medios de informacin? Aydanos!\nTe invitamos a participar en un seminario web online (en ingls) el martes 20 de mayo a las 15:00 horas, donde co-disearemos la narrativa y el formato de escape rooms educativas utilizando un enfoque de diseo participativo.\nEsta sesin de dos horas reunir a expertos y jvenes para compartir sus perspectivas y desarrollar de manera colaborativa narrativas, personajes y retos/puzzles que ayuden a los jvenes a reconocer la desinformacin y fortalecer sus habilidades de pensamiento crtico.\nA travs de una serie de talleres de co-diseo que se llevarn a cabo en varias etapas del proyecto, definiremos la narrativa, el formato y los temas de las escape rooms de manera que resulten motivadoras y atractivas para los jvenes, yendo ms all de las actividades de aprendizaje tradicionales. Estamos comprometidos con la inclusin de grupos diversos incluyendo personas de diferentes gneros, etnias, capacidades y orgenes para asegurar que los elementos visuales y las historias sean inclusivos, respetuosos y relevantes para una audiencia amplia.`,\n        description_fi: `Oletko opettaja, medialukutaidon asiantuntija, pelisuunnittelija tai -kehittj iltsi 1825 vuotta, tai tyskenteletk kansalaisjrjestss tai mediatoimijana? Liity mukaan!\nKutsumme sinut osallistumaan kansainvliseen verkkoseminaariin tiistaina 20. toukokuuta klo 15:00, jossa yhteissuunnittelemme opetuksellisten pakopelien tarinoita ja muotoja osallistavan suunnittelun keinoin.\nTss kahden tunnin typajassa asiantuntijat ja nuoret luovat yhdess tarinoita, hahmoja ja pulmia, jotka auttavat nuoria tunnistamaan misinformaatiota ja vahvistamaan kriittisen ajattelun taitojaan.\nSarjassa eri vaiheisiin ajoittuvia yhteissuunnittelutypajoja mrittelemme pakopelien narratiivin, rakenteen ja teemat siten, ett ne ovat nuorille sisisesti motivoivia ja houkuttelevia, ylitten perinteisten oppimistoimintojen rajat. Olemme sitoutuneet moninaisuuden huomioimiseen  mukaan lukien eri sukupuolet, etnisyydet, toimintakyvyt ja taustat  varmistaaksemme, ett visuaaliset elementit ja tarinat ovat inklusiivisia, kunnioittavia ja merkityksellisi laajalle yleislle.`,\n        externalLinkJoin: \"https://uef.zoom.us/meeting/register/d-Ok41vZS_W_fMGyBERFAw#/registration\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\",\n            \"Escape room\",\n            \"Participatory design\"\n        ]\n    },\n    {\n        eventname: \"WorkshopFinland\",\n        category: \"Workshop\",\n        country: \"Finland\",\n        type: \"Event\",\n        date: \"05/16/25\",\n        hour: \"12:00 UTC+3\",\n        title_en: \"Misinformation narratives in Finland\",\n        description_en: `Were inviting participants to take part in a media literacy workshop as part of the EU-funded ENDGAME project. If you are between 18 and 30 years old and are tired of being exposed to misinformation (e.g., related to migrants, climate change, or cryptocurrency), we want to hear your experience! \n\n    In this interactive session, you'll help identify the most pressing misinformation narratives and media literacy challenges facing young people today. The results will be used to design educational escape rooms that train critical thinking and digital resilience.`,\n        externalLinkJoin: \"https://docs.google.com/forms/d/e/1FAIpQLScyhbCM1wKiRlkt-z8dfbtDKazVuA3T2Xh_1fJ3BZJMSWcLtg/viewform\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    },\n    {\n        eventname: \"WorkshopSerbia\",\n        category: \"Workshop\",\n        country: \"Serbia\",\n        type: \"Event\",\n        date: \"05/14/25\",\n        hour: \"18:00 UTC+1\",\n        title_en: \"Online workshop: Identifying disinformation\",\n        title_sr: \"Virtuelna radionica: Identifikacija dezinformacija\",\n        description_en: ` If you work in journalism or teaching, are a student or work with young people, we need you!\n   \nOn Wednesday, May 14 at 6:00 pm we invite you to participate in a one-hour online session in which we will talk, share ideas and listen to your experience to analyze the digital habits and misinforming narratives faced by Serbian youth.  \n \nIn this session, experts will contribute their opinions and experiences to help shape various educational materials to help youth recognize disinformation and strengthen their critical thinking. We want these resources to be truly useful, accessible and connected to the real needs of society. To achieve this, we need people like you. Having you is a huge help to all of us who are designing this project.  `,\n        description_sr: `Ako radite u novinarstvu ili nastavi, student ste ili radite sa mladima, potrebni ste nam!\n\nU sredu, 14. maja u 18:00 asova pozivamo vas da uestvujete u jednoasovnoj onlajn sesiji u kojoj cemo razgovarati, deliti ideje i sluati vaa iskustva kako bismo analizirali digitalne navike i dezinformacije sa kojima se suoavaju mladi u Srbiji.\nU ovoj sesiji, strunjaci ce doprineti svojim razmiljanjima i iskustvom kako bi pomogli u oblikovanju razliitih obrazovnih materijala koji ce pomoci mladima da prepoznaju dezinformacije i ojaaju svoje kritiko rmiljenje. elimo da ovi resursi budu zaista korisni, pristupani i povezani sa stvarnim potrebama drutva. Da bismo to postigli, potrebni su nam ljudi poput vas. Vae prisustvo je ogromna pomoc svima nama koji radimo na ovom projektu. `,\n        externalLinkJoin: \"https://forms.gle/aL2x5URUz1sEbJLaA \",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    },\n    {\n        eventname: \"WorkshopSpain\",\n        category: \"Workshop\",\n        country: \"Spain\",\n        type: \"Event\",\n        date: \"05/07/25\",\n        hour: \"17:00 UTC+1\",\n        title_en: \"Narratives under the Magnifying Glass: Designing Educational Tools against Disinformation\",\n        title_es: \"Narrativas bajo la Lupa: Diseando Herramientas Educativas contra la Desinformacin\",\n        description_en: `If you work in journalism or teaching, are a student or work with young people, we need you! \n    \nOn Wednesday, May 7 at 5:00 pm we invite you to participate in a one-hour online session in which we will talk, share ideas and listen to your experience to analyze the digital habits and misinforming narratives faced by Spanish youth.  \n\nIn this session, experts will contribute their opinions and experiences to help shape various educational materials to help youth recognize disinformation and strengthen their critical thinking. We want these resources to be truly useful, accessible and connected to the real needs of society. To achieve this, we need people like you. Having you is a huge help to all of us who are designing this project. `,\n        description_es: `\nSi te dedicas al periodismo o la docencia, eres estudiante o trabajas con jvenes, te necesitamos! \n    \nEl mircoles 7 de mayo a las 17:00 h (hora Madrid) te invitamos a participar en una sesin online de una hora en la que conversaremos, compartiremos ideas y escucharemos tu experiencia para analizar los hbitos digitales y las narrativas desinformadoras a las que se enfrenta la juventud espaola.  \n\nEn esta sesin, personas expertas aportarn su opinin y vivencias para ayudar a dar forma a diversos materiales educativos que ayuden a a juventud a reconocer la desinformacin y a fortalecer su pensamiento crtico. Queremos que estos recursos sean verdaderamente tiles, accesibles y conectados con las necesidades reales de la sociedad. Para lograrlo, necesitamos contar con personas como t. Contar contigo es una enorme ayuda para todas las personas que estamos diseando este proyecto. `,\n        // short description -> eventCard\n        externalLinkJoin: \"https://forms.gle/6HugpAZw7oSqDTc56\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./constants/events.js\n");

